    __webpack_exports__["default"] = "<mat-sidenav-container>\n    <mat-sidenav [(opened)]=\"opened\">\n        <h4><strong>Currently we can offer you this connector in the form of a csv export. Just click on \"Export\" to download the csv.</strong></h4>\n        <h2>About this file</h2>\n        <p>This file contains information on economic topics adressed throughout the introductory statements of the president of the European Central Bank in front of the european parliament, as well as information on financial sentiment. All calculations were performed down to the granularity level of the single categories of those introductory statements. All categories are matched with their exact start and endtimes.</p>\n        <br>\n        <h2>Details on Data Sources and Methodology</h2>\n        <p>In a first step the European Central Banks official website (www.ecb.europa.eu) is automatically crawled and all official transcripts of the hearings in scope are extracted. Every hearing is split into its several categories. In order to check for real-time impact of the information published in the hearings, the categories first words are automatically matched with their exact timestamps, generated with the help of the official webcast of each corre- sponding hearing. This provides us with the exact start-time and duration of every category in the hearing. Every category is then analysed on financial tone and topic, using simple calculations for tone and a K-Means algorithm for topics. In a final step tone and topic are merged with returns from the stock market and their associated information contents real-time impact on financial markets is assessed.</p>\n        <img class=\"center\" src=\"assets/images/graph_methodology.png\" alt=\"Let the sun rise\">\n        <br>\n        <h2>Columns</h2>\n        <table mat-table [dataSource]=\"dataSource\" class=\"mat-elevation-z8\">\n\n            <!--- Note that these columns can be defined in any order.\n                  The actual rendered columns are set as a property on the row definition\" -->\n          \n          \n            <!-- Name Column -->\n            <ng-container matColumnDef=\"name\">\n              <th mat-header-cell *matHeaderCellDef> Name </th>\n              <td mat-cell *matCellDef=\"let element\"> {{element.name}} </td>\n            </ng-container>\n          \n\n          \n            <!-- Symbol Column -->\n            <ng-container matColumnDef=\"description\">\n              <th mat-header-cell *matHeaderCellDef> Description </th>\n              <td mat-cell *matCellDef=\"let element\"> {{element.description}} </td>\n            </ng-container>\n          \n            <tr mat-header-row *matHeaderRowDef=\"displayedColumns\"></tr>\n            <tr mat-row *matRowDef=\"let row; columns: displayedColumns;\"></tr>\n          </table>\n          \n        \n    </mat-sidenav>\n\n    <mat-sidenav-content>\n        <div fxLayout=\"row\" fxLayoutAlign=\"space-between center\" fxLayoutGap=\"20px\" class=\"stats-cards\">\n            <div>\n                <h1><b>First Glance - Analysis of ECB Hearings</b></h1> \n            </div>\n            <div fxLayout=\"row\" fxLayoutAlign=\"space-between center\" fxLayoutGap=\"20px\" class=\"stats-cards\">\n                <div class=\"wrapper\">\n                    <button (click)=\"opened=!opened\" class=\"cta_right\" >Technical Details</button>\n                </div>\n                <div class=\"wrapper\">\n                    <a routerLink=\"projects\"><button class=\"cta_right\" >Export</button></a>\n                </div>\n        \n            </div>    \n        </div>\n        \n        \n        <br>\n        <p>\n            In this analysis we first of all find increased market volatility during the hearings and their single categories. The volatility significantly depends on which topics are addressed throughout a hearing. We interpret this as a sign that market participants follow the hearings in real-time. Additionally we find that certain topics are especially interesting to market participants. Communication about Standard Monetary Measures has a sig- nificant positive impact on asset prices. Furthermore we find that positive (negative) financial tone during a hearing has a significant positive (negative) impact on asset prices. \n        </p>\n        <br>\n        <br>\n        <div fxLayout=\"row\" fxLayoutAlign=\"space-between center\" fxLayoutGap=\"20px\" class=\"stats-cards\">\n            <mat-card fxFlex=\"25\">\n                <mat-card-header fxLayoutAlign=\"center\">\n                    <mat-card-title>#Analysed ECB Hearings</mat-card-title>\n                </mat-card-header>\n                <mat-card-content fxLayoutAlign=\"center\">\n                    <h1>35</h1>\n                </mat-card-content>\n            </mat-card>\n            <mat-card fxFlex=\"25\">\n                <mat-card-header fxLayoutAlign=\"center\">\n                    <mat-card-title>#Different paragraphs in all Hearings</mat-card-title>\n                </mat-card-header>\n                <mat-card-content fxLayoutAlign=\"center\">\n                    <h1>141</h1>\n                </mat-card-content>\n            </mat-card>\n            <mat-card fxFlex=\"25\">\n                <mat-card-header fxLayoutAlign=\"center\">\n                    <mat-card-title>#Days since last Hearing</mat-card-title>\n                </mat-card-header>\n                <mat-card-content fxLayoutAlign=\"center\">\n                    <h1>62</h1>\n                </mat-card-content>\n            </mat-card>\n        \n        </div>\n        \n        <br>\n        <br>\n        \n        <div>\n            <app-widget-line></app-widget-line>\n        </div>\n        \n        <br>\n        <br>\n        \n        <div fxLayout=\"row\" fxLayoutAlign=\"space-between center\" fxLayoutGap=\"20px\" class=\"stats-cards\">\n            <div>\n                <app-widget-pie></app-widget-pie>\n            </div>\n            <mat-card fxFlex=\"25\">\n                <mat-card-header fxLayoutAlign=\"center\">\n                    <mat-card-title>#Different paragraphs in all Hearings</mat-card-title>\n                </mat-card-header>\n                <mat-card-content fxLayoutAlign=\"center\">\n                    <h1>141</h1>\n                </mat-card-content>\n            </mat-card>\n        \n        \n        </div>\n        <br>\n        \n        \n        \n        \n    </mat-sidenav-content>\n</mat-sidenav-container>\n\n\n\n\n";
