    __webpack_exports__["default"] = "\n<div class=\"content\">\n  <div style=\"text-align:justify\">\n    <div style=\"text-align:center\">\n      <h1>Welcome to SophiaData</h1>\n    </div>\n    <div style=\"text-align:center\">\n      <h3>We are a young German Start-Up and we built Sophia, the Artifical Intelligence that connects researchers and businesses to the world's data.</h3>\n\n      <h3>Sophia will search the worlds information based on your preferences to fulfill your need for reviewed and analysed data. Just try it out.</h3>\n      <div class=\"wrapper\">\n        <a routerLink=\"projects\"><button class=\"cta\" >Search</button></a>\n      </div>\n    </div>\n    <br>\n\n    <img class=\"center\" src=\"assets/images/HDEVsunrise.gif\" alt=\"Let the sun rise\">\n    \n    <br>\n    <div style=\"text-align: center\">  \n      <h1>Build your individual connector.</h1>\n    </div>\n    <br><br>\n\n    <div *ngIf=\"!name; else forminfo\">\n      <form [formGroup]=\"messageForm\" (ngSubmit)=\"addpost(messageForm.value)\">\n        <div class=\"form-container\">\n          <div class=\"row columns\">\n            <h2>Request a customized connector</h2>\n\n            <label>Name\n              <input type=\"text\" formControlName=\"name\">\n            </label>\n          \n\n            <label>Institution/ Company/ Private\n              <input type=\"text\" formControlName=\"institution\">\n            </label>\n\n            <label>E-Mail\n              <input type=\"text\" formControlName=\"email\">\n            </label>\n            <div class=\"alert\" *ngIf=\"!messageForm.controls['email'].valid && messageForm.controls['email'].touched\">Please submit your email address so we can contact you.</div>\n    \n            <label>Description\n              <textarea  formControlName=\"description\"></textarea>\n            </label>\n            <div class=\"alert\" *ngIf=\"!messageForm.controls['description'].valid && messageForm.controls['description'].touched\">Please submit a description between 30 and 500 characters so Sophia knows what it is looking for.</div>\n            \n\n            \n            <input type=\"submit\" class=\"button expanded\" value=\"Submit Form\" [disabled]=\"!messageForm.valid\">\n          </div>\n        </div>\n      </form>\n    </div>\n    \n    <ng-template #forminfo>\n      <div class=\"form-container\">\n        <div class=\"row columns\">\n            <h1>{{ name }}</h1>\n            <h1>{{ institution }}</h1>\n            <h1>{{ email }}</h1>\n            <p>{{ description }}</p>\n        </div>\n      </div>\n    </ng-template>\n\n    <br>\n    <br>\n\n    <h1 style=\"text-align: center;\">About Us</h1>\n    <p>\n      We empower businesses and researchers to build their individual world formulas!\n      There has never been more data publicly available. We believe that mining and analyzing publicly available, unstructured data and connecting it\n      to existing datasets can generate enormous value. In order to utilize the world's data, we have built Sophia. An Artifical Intelligence that satisfies your needs with\n      real-time and customizable datasets. We call those datasets \"connectors\". \n  </p>\n  <p>\n      Just try it out and define what kind of dataset you are looking for and Sophia will automatically start building your\n      individual connector to the outside world.\n  </p>\n  <p>\n      <b>If you don't know what you are looking for yet, just browse our existing connectors and previous projects.</b>\n  </p>\n  <br>\n  <div class=\"wrapper\">\n    <a routerLink=\"projects\"><button class=\"cta\" >Check out previous projects</button></a>\n</div>\n  <br>\n  <br>\n  <h1 style=\"text-align: center;\">Our Approach</h1>\n  <h1 style=\"text-align: center;\">Latest Research - Customer Wishes - Technology</h1>\n  <p>\n    have three icons for the three bullet points above to explain what we mean: \n    We believe that a lot of future trends can be found in research already today. We want to close the gap between science and businesses.\n    We are currently looking for co innovation projects to build Sophia based on what our customers need.\n    We want to connect our customers to the worlds data as easy as possible. That means integrating our data sources directly into our client's workflows without tedious analyst work and number crunshing.\n      Sophia is still quite young and currently in beta. This service is completely free for you.\n  </p>\n  </div>\n</div>\n\n";
